"use strict";angular.module("esef.frontend.notification",["ui.bootstrap.modal"]).run(["$templateCache",function(a){a.put("notification/views/confirm-dialog.html",'<div class="modal-body"><h4 class="modal-title"><i class="fa fa-comment"></i> {{ title }}</h4><hr/><p translate>{{ message }}</p><div class="text-right"><button type="button" class="btn btn-default" ng-click="$close(false)">Cancel</button><button type="button" class="btn btn-danger" ng-click="$close(true)">Yes</button></div></div>')}]),angular.module("esef.frontend.notification").factory("esefNotify",["$modal",function(a){return{confirm:function(b,c){return a.open({templateUrl:"notification/views/confirm-dialog.html",size:"sm",controller:["$scope","title","message",function(a,b,c){a.title=b,a.message=c}],resolve:{title:function(){return b},message:function(){return c}}}).result}}}]);